function index_body_file_init(){$("#file-form .progress").hide();$("#file-form fieldset button:eq(0)").on("click",function(){window.open("src/file/fileTemplates/"+$("#templateSelect").val()+".xlsx")});$("#file-form fieldset button:eq(1)").on("click",function(){let file=$("#uploadFile").get(0).files[0];console.log(file.toString());if(file===undefined){myAlert("请选择文件!");return}let formData=new FormData();formData.append("uploadFile",file);console.log(formData.get("uploadFile"));$("#file-form .progress").show();$("#file-form .progress .progress-bar").addClass("active");$("#file-form .progress .progress-bar").removeClass("progress-bar-success");$.ajax({url:"dataUpload",type:"post",data:formData,processData:false,contenType:false,async:true,dataType:"json",success:function(a){if(a==="0"){myAlert("上传失败!")}else{$("#file-form .progress .progress-bar").removeClass("active");$("#file-form .progress .progress-bar").addClass("progress-bar-success")}},error:function(a){alert("----ajax请求上传文件出错！错误信息如下：----\n"+a.responseText)}})})};